import React from "react";
import "./login.css";
import "./signup"
import "./password"
import { Link } from "react-router-dom";
import "./home"
const Login = () => {
  return (
    <div className="login-page">
      <div className="bg-3-1">
        <span className="login">LOGIN</span>
        <div className="form">
        <form>
        <span className="name1">NAME</span>
        <input type="text" className="name"></input><br></br>
        <span className="name2">PASSWORD</span>
        <input type="text" className="name"></input><br></br>
        <span className="name3">PHONE NO</span>
        <input type="text" className="name"></input><br></br>
        </form>
        </div>
        <a><Link to="/Home">SIGN IN</Link></a>
        <div className="flex-container">
        <a><Link to="/Signup">Create an account!</Link></a>
        <a><Link to="/Password">Forgot password?</Link></a>
        </div>
      </div>
    </div>
  );
};
export default Login;
